import React from 'react';
import { Link } from 'react-router-dom';
import zealthyLogo from '..//zealthyLogo.jpg';

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container-fluid">
        <Link className="navbar-brand" to="/">
          <img src={zealthyLogo} alt="Zealthy Logo" width="30" height="30" className="d-inline-block align-top" />
          Zealthy
        </Link>
        <div className="collapse navbar-collapse">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <Link className="nav-link" to="/">TicketForm</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/login">Admin Login</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
